import React, { Component } from "react";
import "./Skills.css";

class Skills extends Component {
  render() {
    return (
      <section id="skills" className="skills">
        <h2>Skills</h2>
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>JavaScript</li>
          <li>React JS</li>
          <li>Python</li>
          <li>SQLite</li>
          <li>Java</li>
          <li>C</li>
          <li>NodeJS</li>
        </ul>
      </section>
    );
  }
}

export default Skills;
